short_description:
Great Opportunities Come in Small Packages

Introducing the all new <strong>Onyx-W ATM</strong>. The Onyx-W can be installed securely as a <strong>Wall Mount</strong> or on a <strong>Counter Top</strong>. You're installation options are only limited by your imagination.

&nbsp;

Proof positive that innovation comes in small packages.

Innovative Design - The 4000W provides unsurpassed convenience to all user interface through an 8-inch color LCD screen.  The 4000W was designed with speed and ease-of-use in mind so you get rapid transaction processing and speedy service.

&nbsp;

long_description:
Among the world”s smallest and lightest devices, the iCT 250 is designed for easy handling and robust daily use. The backlit keypad makes PIN entry and menu navigation easy and intuitive. Also, the large keys and power buzzer speed transactions and reduce PIN entry errors. Offering EMV chip &amp; PIN, magstripe, and NFC/contactless payment, the iCT 250 also enables new NFC couponing and wallet applications.

&nbsp;

&nbsp;

